class Solution:
    def totalSteps(self, nums):
        total_steps = self.calc_total_steps(build_linked_list(nums))
        return total_steps

    def calc_total_steps(self, list):
        if not list.head:
            return 0
        curr = list.head
        if not curr.next:
            return 0
        curr = list.head
        prev = curr
        curr = curr.next
        in_order = False
        steps = 0
        tmp = None
        while not in_order:
            pop_count = 0
            if not curr:
                break
            while curr:
                if (prev.data > curr.data):
                    in_order = False
                    tmp = curr
                    if not tmp.next:
                        prev.next = curr.next
                        pop_count += 1
                    else:
                        tmp_prev = prev
                        while tmp and tmp.next and tmp.data < tmp_prev.data:
                            pop_count += 1
                            tmp_prev = tmp
                            tmp = tmp.next
                        if not tmp.next and tmp.data < tmp_prev.data:
                            pop_count += 1
                            prev.next = tmp.next
                        else:
                            prev.next = tmp
                        curr = tmp
                if not curr.next:
                    if not pop_count:
                        in_order = True
                        break
                    else:
                        # list.print_list()
                        steps += 1
                        curr = list.head
                        pop_count = 0
                prev = curr
                curr = curr.next
            if in_order:
                break
        return max(steps, 0)


